import sys
import base64
from PyQt5.QtWidgets import QApplication, QLabel
from PyQt5.QtGui import QPixmap, QColor, QImage
from PyQt5.QtCore import Qt, QTimer

#Base64 PNG 이미지
BASE64_IMAGE = """"""

def load_base64_image(base64_string):
    image_data = base64.b64decode(base64_string)
    image = QImage()
    image.loadFromData(image_data)
    return QPixmap.fromImage(image)

class FloatingLogo(QLabel):
    def __init__(self):
        super().__init__()

        #기본 로고 로드, 크기
        self.original_logo = load_base64_image(BASE64_IMAGE)
        self.logo_size = (500, 250)
        self.precolored_logos = self.generate_colored_logos()
        self.current_logo_index = 0
        self.setPixmap(self.precolored_logos[self.current_logo_index])
        self.resize(self.precolored_logos[self.current_logo_index].size())

        #창 투명, 항상 위, 클릭 차단
        self.setWindowFlags(Qt.FramelessWindowHint | Qt.WindowStaysOnTopHint | Qt.Tool)
        self.setAttribute(Qt.WA_TranslucentBackground)

        #초기 위치, 속도
        self.x_speed = 2
        self.y_speed = 2
        self.screen_rect = QApplication.primaryScreen().geometry()
        self.move(100, 100)

        self.timer = QTimer(self)
        self.timer.timeout.connect(self.update_position)
        self.timer.start(10)  # 10ms마다 위치 업데이트

    #색상 로고 저장, 빨부노초파남보
    def generate_colored_logos(self):
        colors = [
            QColor(255, 0, 0),
            QColor(255, 165, 0),
            QColor(255, 255, 0),
            QColor(0, 255, 0),
            QColor(0, 0, 255),
            QColor(75, 0, 130),
            QColor(148, 0, 211)
        ]
        
        colored_logos = []
        for color in colors:
            mask = self.original_logo.createMaskFromColor(Qt.transparent, Qt.MaskInColor)
            colored_logo = QPixmap(self.original_logo.size())
            colored_logo.fill(color)
            colored_logo.setMask(mask)
            colored_logos.append(colored_logo.scaled(*self.logo_size, Qt.KeepAspectRatio, Qt.SmoothTransformation))
        
        return colored_logos

    def update_position(self):
        x, y = self.x() + self.x_speed, self.y() + self.y_speed
        bounced = False

        #화면 경계를 넘으면 방향 반전 및 색상 변경
        if x <= 0 or x + self.width() >= self.screen_rect.width():
            self.x_speed = -self.x_speed
            bounced = True
        if y <= 0 or y + self.height() >= self.screen_rect.height():
            self.y_speed = -self.y_speed
            bounced = True

        if bounced:
            self.change_logo_color()

        self.move(x, y)

    #미리 저장한 색상 리스트에서 다음 색상 선택
    def change_logo_color(self):

        self.current_logo_index = (self.current_logo_index + 1) % len(self.precolored_logos)
        self.setPixmap(self.precolored_logos[self.current_logo_index])

    #클릭 시 종료
    def mousePressEvent(self, event):
        QApplication.quit()

if __name__ == "__main__":
    app = QApplication(sys.argv)
    window = FloatingLogo()
    window.show()
    sys.exit(app.exec_())
